import React from 'react';



const NavBar = (props) => {

	return (

			<div className={"items-center flex p-4"}>

				<div>{"Welcome, Beod"}</div>

				<div className={"bg-silver items-center flex justify-end grow"}>
					<div className={"bg-purple flex justify-items-center"}> 
						<input className={"mr-8"} value={'s'} type="text" name="search" id="search" />
						<div> 
							<span>s</span>
						</div>
					</div>
				</div>

			</div>
		);
}

export default NavBar;
